INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `description`, `image`) VALUES
(1, 'Max', 'Golden Retriever', 4, 'Max is an energetic and friendly Golden Retriever. He loves running around the park, playing fetch, and snuggling on the couch after a long day. His golden fur is always shining, and his wagging tail is contagious, bringing joy to anyone around him. Max is highly social and gets along well with other dogs and people, making him the perfect family companion.', ),
(2, 'Luna', 'Maine Coon', 3, 'Luna is a majestic Maine Coon with beautiful long fur and striking green eyes. She has a gentle, calm personality and loves lounging by the window while watching birds. Luna is independent but enjoys affection on her own terms, often curling up next to her favorite humans. Her large size and fluffy tail give her a regal appearance, but her playful side shines when she chases toys.', );
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `description`, `image`) VALUES
(3, 'Thumper', 'Flemish Giant', 2, 'Thumper is a gentle and curious Flemish Giant rabbit. Known for his large size and calm demeanor, he enjoys hopping around the house and exploring new places. Thumper is very sociable and loves interacting with his human family members. His soft, grey fur and big ears make him look even more adorable when he’s lounging in his favorite corner. He’s a bit of a foodie, particularly fond of fresh carrots and leafy greens!', ),
(4, 'Kiwi', 'African Grey Parrot', 5, ' Kiwi is a highly intelligent African Grey Parrot with stunning gray feathers and a bright red tail. Kiwi loves to mimic sounds and has a growing vocabulary of words and phrases. He enjoys sitting on his perch, chirping happily while observing the world around him. Kiwi is very affectionate and often enjoys being hand-fed treats, especially fruits like apples and bananas. His playful, cheeky nature makes him a joy to have as a companion.', );
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `description`, `image`) VALUES
(5, 'Bella', 'Beagle', 3, ' Bella is a playful and curious Beagle with a nose for adventure. She’s always sniffing around the yard, exploring new smells, and loves going on long walks. With her signature tricolor coat (brown, white, and black) and soulful eyes, Bella captures the hearts of everyone she meets. She’s friendly and loyal to her family, and although she can be a bit stubborn, her gentle nature and loving personality always shine through.', ),
(6, 'Zeus', 'Great Dane', 6, 'Zeus is a gentle giant with a heart as big as his frame. As a Great Dane, he towers over other dogs, but he’s surprisingly calm and affectionate. He loves lying on the couch, getting belly rubs, and playing with his favorite squeaky toy. His sleek blue coat and massive size make him an imposing figure, but he\'s the sweetest, most loyal companion you\'d ever meet. He loves kids and gets along well with other pets.', );
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `description`, `image`) VALUES
(7, 'Oliver', 'British Shorthair', 4, 'Oliver is a charming British Shorthair with a plush blue-gray coat and amber eyes that melt your heart. He’s laid-back, yet he has a playful side and enjoys chasing his favorite feather toy. He’s known for being quite vocal, especially when it’s time for dinner. Oliver is very affectionate and loves curling up in a cozy spot on the couch, purring contentedly as he relaxes with his family. His stocky build and round face give him a distinctive, adorable look.', ),
(8, 'Nala', 'Sphynx', 2, 'Nala is a playful and affectionate Sphynx cat known for her hairless body and large ears. Despite her lack of fur, Nala is incredibly warm to the touch and enjoys snuggling under blankets. She loves attention and will follow her human family members around the house, demanding love and affection. Nala’s wrinkled skin and big eyes make her look endearing, and she has a quirky, fun-loving personality that lights up any room.', );

